import { useState } from 'react'

export default function Navbar(props) {
    const [input,setinput]= useState("")
const {handleSearch,MovieData}= props
const {id}=MovieData
    const handleChange=(e)=>{
        let value= e.target.value
        setinput(value)
    }
    console.log(id,"id")
  return (
    <div>
            <input type = "textbar" placeholder='Search for Movies' onChange={handleChange}value={input}/>
                <button onClick ={(e)=>handleSearch(e,id)}>Search</button>
          
             {MovieData&&MovieData.map((item)=>{
                
                <div>{item}
            </div>
            })} 
    </div>
  )
}
